import './App.css';
import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  formatRows() {
    var buy_rows = [];
    var sell_rows = [];
    for (const coin of this.state.coins) {
      var b_row = [coin.ticker];
      var s_row = [coin.ticker];
      for ([key,value] in coin.buy_prices) {
        b_row.push(value);
      }
      for ([key,value] in coin.sell_prices) {
        s_row.push(value);
      }
      buy_rows.push(b_row);
      sell_rows.push(s_row);
    }
    return [buy_rows, sell_rows];
  }

  componentDidMount() {
    fetch("http://localhost:8080/coinexchange")
    .then(res => res.json())
    .then(
        (res) => {
          this.setState({
            exchanges: res[0],
            coins: res[1]
          });
        }
      );
  }

  render() {
    console.log(this.state);
    const [buy_rows, sell_rows] = formatRows();
    console.log("buy rows: " + buy_rows);
    console.log("sell rows: " + sell_rows);
    return (
      <div>
        { this.state.exchanges }
        { this.state.coins }
      </div>
    );
  }
}


export default App;
